import { useEffect } from "react";
import { ButtonGroup, DropdownDivider } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";
import { useDispatch, useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import { checkAuth, logout } from "../store/actions/authActions";
import { setCurrentUser } from "../store/slices/authSlice";
import "../index.css";
import { checkAuthFreeLance } from "../store/actions/authActionsFreeLance";

function NavScrollExample() {
  const navigate = useNavigate();
  const dispatch = useDispatch();

  useEffect(() => {
    if (localStorage.getItem("tokens")) {
      dispatch(checkAuth());
      dispatch(checkAuthFreeLance());
    }
  }, []);

  const handleLogout = () => {
    logout();
    dispatch(setCurrentUser());
    navigate("/login");
  };

  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="/">
          <a href="/">
            <img
              className="nav-logo"
              style={{
                width: "10em",
              }}
              src="https://ww2.freelogovectors.net/wp-content/uploads/2019/03/freelancerlogo.png"
              alt=""
            />
          </a>
        </Navbar.Brand>
        <Navbar.Toggle className="menu__burger" aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="burger-menu_bg"
            style={{
              maxHeight: "180px",
            }}
            navbarScroll
          >
            <Nav.Link
              className="nav-item"
              style={{
                fontWeight: "700",
                fontSize: "1.2em",
                marginLeft: "5em",
              }}
              onClick={() => navigate("/posts")}
            >
              Посты
            </Nav.Link>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Поиск..."
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Найти</Button>
            </Form>
            <NavDropdown
              style={{
                fontWeight: "600",
                fontSize: "1.2em",
                marginLeft: "2em",
              }}
              title="Sign Up"
              id="navbarScrollingDropdown"
            >
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/register")}
              >
                Customer
              </NavDropdown.Item>
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/register-freelancer")}
              >
                Freelancer
              </NavDropdown.Item>
              <DropdownDivider />
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={handleLogout}
              >
                Выйти
              </NavDropdown.Item>
            </NavDropdown>
            <NavDropdown
              style={{
                fontWeight: "600",
                fontSize: "1.2em",
                marginLeft: "2em",
              }}
              title="Log In"
              id="navbarScrollingDropdown"
            >
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/login")}
              >
                Customer
              </NavDropdown.Item>
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={() => navigate("/login-freelancer")}
              >
                Freelancer
              </NavDropdown.Item>
              <DropdownDivider />
              <NavDropdown.Item
                style={{ fontWeight: "500" }}
                onClick={handleLogout}
              >
                Выйти
              </NavDropdown.Item>
            </NavDropdown>

            <Nav.Link href="#" disabled>
              <svg
                style={{
                  marginLeft: "4em",
                  background: "#1d1c1c",
                  borderRadius: "50%",
                  border: "1px solid gray",
                }}
                xmlns="http://www.w3.org/2000/svg"
                width="35"
                height="35"
                fill="currentColor"
                class="ava-user"
                viewBox="0 0 16 16"
              >
                <path d="M11 6a3 3 0 1 1-6 0 3 3 0 0 1 6 0" />
                <path
                  fillRule="evenodd"
                  d="M0 8a8 8 0 1 1 16 0A8 8 0 0 1 0 8m8-7a7 7 0 0 0-5.468 11.37C3.242 11.226 4.805 10 8 10s4.757 1.225 5.468 2.37A7 7 0 0 0 8 1"
                />
              </svg>
              <div
                style={{
                  position: "absolute",
                  color: "#1d1c1c",
                  top: "1.5em",
                  left: "54em",
                  fontWeight: "600",
                }}
                className="user-name"
              >
                {currentUser ? currentUser : "No auth"}
              </div>
            </Nav.Link>
          </Nav>
          <Form className="inp-search">
            <Form.Control
              type="search"
              placeholder="Поиск..."
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success" className="my-button">
              Найти
            </Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
